    public function testRegister()
    {
        $this->setUpEnvironment();

        $request = new UserRegisterRequest();

        $input = [
            'name' => 'Everton Miranda de Oliveira',
			'cpf' =>  '23378118830',
			'email' => 'notreve.miranda@gmail.com',
			'email_confirmation' => 'notreve.miranda@gmail.com',
			'birthday' => '1994-06-22',
			'terms' => true,
			'phones' => [
                'cellphone' => '5511964888438' 
            ],
        ];
        
        $request->merge($input);

        $result = $this->userController->register($request);

        $this->assertTrue(isset($result->userId));
    }

    public function testErrorCheckAlpha()
    {
        $this->setUpEnvironment();

        $request = new UserCheckAlphaRequest();

        $input = [
            'userId' => self::USER_ID,
            'badCredit' => false
        ];

        $request->merge($input);

        $result = $this->userController->checkAlpha($request);

        $this->assertTrue($result->status() == 422);
    }

    public function testSucessCheckAlpha()
    {
        $this->setUpEnvironment();

        $request = new UserCheckAlphaRequest();

        $input = [
            'userId' => self::USER_ID,
            'badCredit' => false
        ];

        $request->merge($input);

        $result = $this->userController->checkAlpha($request);

        $this->assertTrue($result->userId == $input['userId']);
    }

